export default function Dashboard({ data }) {
	return (
		<div>
			<Link href="/">
				<a title="Dashboard">Create new policy</a>
			</Link>
			<div>{data[0].first_name}</div>
		</div>
	);
}

export async function getServerSideProps() {
	const res = await fetch('http://localhost:4000/policies');
	const data = await res.json();
	return { props: { data } };
}

